import React from "react";

const Results = ({ score, totalQuestions }) => {
  return (
    <div className="results-container">
      <h2>Вітаємо! Квіз завершено!</h2>
      <p>
              Ваш результат: <br/>
             правильних відповідей {score} з {totalQuestions}
      </p>
    </div>
  );
};

export default Results;
